#############################################################################################################
### USER OVERRIDES
### Anything custom you want to add, or RatOS configuration you want to override, do it here.
### See: https://os.ratrig.com/docs/configuration/includes-and-overrides
#############################################################################################################
[include led.cfg]

[printer]
max_velocity: 1100
max_accel: 10000
max_accel_to_decel: 2500
square_corner_velocity: 15.0

[input_shaper]
shaper_freq_x: 91.4
shaper_freq_y: 51.4
shaper_type: mzv

[controller_fan Manta_Fan] #controller_fan
pin: PE5
hardware_pwm: True
kick_start_time: 0.500
max_power: 0.8
fan_speed: 0.5
off_below: 0.2
shutdown_speed: 0.5

[heater_fan toolhead_cooling_fan]
pin = toolboard:fan_toolhead_cooling_pin
fan_speed = 0.5

[fan]
pin: toolboard:PB3
enable_pin: toolboard:PA0
cycle_time: 0.00004

[extruder]
sensor_type: PT1000

[temperature_sensor Enclosure_Top]
sensor_type: NTC 100K MGB18-104F39050L32
sensor_pin: PA1

#[temperature_sensor Enclosure Mid]
#sensor_type:
#sensor_pin:

[temperature_sensor Enclosure_Bot]
sensor_type: NTC 100K MGB18-104F39050L32
sensor_pin: PA2

[neopixel Toolhead_Light]
pin: toolboard:PD3
chain_count: 5
color_order: GRB

[neopixel Top_Light]
pin: PA9
chain_count: 73
color_order: GRB

[z_tilt]
speed: 800
z_positions = 
	0,0
	200,400
	400,0
points = 
	60,60
    340,60
    200,340
    
horizontal_move_z = 2
retries = 10
retry_tolerance = 0.01

[beacon]
trigger_distance: 1.5

[bed_mesh]
speed: 1000
probe_count: 340,34
mesh_min: 30,30
mesh_max: 370,370
#############################################################################################################
### Belted Z with 5160
#############################################################################################################
[stepper_z]
endstop_pin: probe:z_virtual_endstop
step_pin: z0_step_pin
dir_pin: z0_dir_pin
enable_pin: !z0_enable_pin
rotation_distance: 40
gear_ratio: 51:1
microsteps: 64
position_min: -5 # Needed for z-offset calibration and tilt_adjust.
homing_speed: 10
homing_retract_dist: 0


[stepper_z1]
step_pin: z1_step_pin
dir_pin: z1_dir_pin
enable_pin: !z1_enable_pin
rotation_distance: 40
gear_ratio: 51:1
microsteps: 64

[stepper_z2]
step_pin: z2_step_pin
dir_pin: !z2_dir_pin
enable_pin: !z2_enable_pin
rotation_distance: 40
gear_ratio: 51:1
microsteps: 64


[tmc5160 stepper_z]
cs_pin: z0_uart_pin
spi_software_mosi_pin: stepper_spi_mosi_pin
spi_software_miso_pin: stepper_spi_miso_pin
spi_software_sclk_pin: stepper_spi_sclk_pin
run_current: 1.768
driver_TBL: 0
driver_TOFF: 4
driver_HEND: 0
driver_HSTRT: 4

[tmc5160 stepper_z1]
cs_pin: z1_uart_pin
spi_software_mosi_pin: stepper_spi_mosi_pin
spi_software_miso_pin: stepper_spi_miso_pin
spi_software_sclk_pin: stepper_spi_sclk_pin
run_current: 1.768
driver_TBL: 0
driver_TOFF: 4
driver_HEND: 0
driver_HSTRT: 4

[tmc5160 stepper_z2]
cs_pin: z2_uart_pin
spi_software_mosi_pin: stepper_spi_mosi_pin
spi_software_miso_pin: stepper_spi_miso_pin
spi_software_sclk_pin: stepper_spi_sclk_pin
run_current: 1.768
driver_TBL: 0
driver_TOFF: 4
driver_HEND: 0
driver_HSTRT: 4

